import '../styles/character-list.scss';
import CharacterCard from './CharacterCard';
import {Link} from 'react-router-dom';

const CharacterList = (props) =>{

    const RenderCharacterList = 
        props.data.map((characterData)=>{
            return(
            <li key={characterData.id} className='characterList__item'>
            <Link to={`./character/${props.user.id}`}>
                <CharacterCard characterData={characterData} user={props.user} />
            </Link></li>)
        })





    return (
        <ul className="characterList">

            {RenderCharacterList}

        </ul>

    );
}

export default CharacterList;
